import React from 'react';
import Theme from './components/Theme'
import Navbar from './components/Navbar'
import Header from './components/Header'


function App() {

	return (
	    <Theme>
	    	<Navbar>
	    		<Header>My Tabletop Hero</Header>

	    	</Navbar>
	    </Theme>
	);
}

export default App;
